export interface ChatRequest {
  message: string;
  agentType?: AgentType;
  conversationContext?: string;
  sessionId?: string;
  userId?: string;
  stream?: boolean;
}

export interface ChatResponse {
  message: string;
  sqlQuery?: string;
  sqlExecuted: boolean;
  sqlResult?: Record<string, any>;
  sources: Source[];
  tokenUsage: TokenUsage;
  contextUtilization?: number;
  agentUsed?: AgentType;
  sessionId: string;
  timestamp: string;
  processingTime?: number;
}

export interface Source {
  content: string;
  metadata: Record<string, any>;
  score: number;
}

export interface TokenUsage {
  prompt: number;
  completion: number;
  total: number;
}

export enum AgentType {
  CREATE = 'create',
  EXPLAIN = 'explain',
  LONGANSWER = 'longanswer', 
  SCHEMA = 'schema',
  NORMAL = 'normal'
}

export interface Message {
  id: string;
  content: string;
  role: 'user' | 'assistant';
  timestamp: Date;
  sqlQuery?: string;
  sqlResult?: any;
  sources?: Source[];
  tokenUsage?: TokenUsage;
  contextUtilization?: number;
  agentUsed?: AgentType;
  isStreaming?: boolean;
}

export interface Conversation {
  sessionId: string;
  messages: Message[];
  createdAt: Date;
  updatedAt: Date;
}

export interface TableSchema {
  name: string;
  columns: Column[];
  relationships: Relationship[];
}

export interface Column {
  name: string;
  type: string;
  nullable: boolean;
  description?: string;
}

export interface Relationship {
  type: 'one-to-one' | 'one-to-many' | 'many-to-many';
  sourceTable: string;
  sourceColumn: string;
  targetTable: string;
  targetColumn: string;
}

export interface QueryItem {
  id: number;
  query: string;
  description?: string;
  tables: string[];
  joins: JoinInfo[];
  tags: string[];
  createdAt?: string;
}

export interface JoinInfo {
  type: string;
  leftTable: string;
  leftColumn: string;
  rightTable: string;
  rightColumn: string;
  condition?: string;
}

export interface SQLExecuteResponse {
  success: boolean;
  totalRows: number;
  cost: number;
  bytesProcessed: number;
  executionTime: number;
  data?: Record<string, any>[];
  errorMessage?: string;
  columnTypes?: Record<string, string>;
}

export interface FilterOptions {
  tables?: string[];
  hasJoins?: boolean;
  hasDescriptions?: boolean;
  minJoinCount?: number;
  maxJoinCount?: number;
}

export interface PaginationOptions {
  page: number;
  pageSize: number;
  total: number;
}

export interface WebSocketMessage {
  type: 'message' | 'error' | 'status' | 'sql_result';
  data: any;
  sessionId: string;
  timestamp: string;
}
